import Link from 'next/link';

function Container({ children }) {
  return (
    <div>
      <Link href="/">
        <a>Index</a>
      </Link>
      <Link href="/about">
        <a>About</a>
      </Link>
      {children}
    </div>
  );
}

export default Container;
